require_once("../../../wp-load.php");
$posts = get_posts( array( 'numberposts' => -1 ) );
$img_count = 0;
$i = 0;
foreach( $posts as $post ){
  error_log( $i . ". Post " . $post->post_name );

  $post_id = $post->ID;
  $offset_gallery = 0;
  
  for( $j = 0; $j < substr_count( $post->post_content, "[gallery" ); $j++ ){
    $gallery_start = strpos( $post->post_content, "[gallery", $offset_gallery );
    $offset_gallery = $gallery_start;
    $gallery_end = strpos( $post->post_content, "]", $offset_gallery );
    $offset_gallery = $gallery_end;

    $gallery_length = $gallery_end - $gallery_start + 1;

    $gallery_substr = substr( $post->post_content, $gallery_start, $gallery_length );

    $offset_ids = 0;
    $ids_start = strpos( $gallery_substr, 'ids="', $offset_ids ) + 5;
    $offset_ids = $ids_start;
    $ids_end = strpos( $gallery_substr, '"', $offset_ids );
    $offset_ids = $ids_end;

    $ids_length = $ids_end - $ids_start;

    $ids_substr = substr( $gallery_substr, $ids_start, $ids_length );

    $ids_arr = explode( ",", $ids_substr );

    $new_ids_arr = array();

    foreach( $ids_arr as $id ){
      foreach( $images as $image ){
        if( $image['ID'] == $id ){
          error_log( $id . ": " . $image['guid'] );
          $img_count++;
          //TODO: Download image and change ID in gallery
          $file = $image['guid'];
          $filename = basename( $file );

          $upload_file = wp_upload_bits( $filename, null, file_get_contents( $file ) );

          if( !$upload_file['error'] ){
            $wp_filetype = wp_check_filetype($filename, null );
            $attachment = array( 
              'post_mime_type' => $wp_filetype['type'],
              'post_title' => preg_replace('/\.[^.]+$/', '', $filename),
              'post_content' => '',
            );
            $attachment_id = wp_insert_attachment( $attachment, $upload_file['file'], $post_id );
            if( !is_wp_error( $attachment_id ) ){
              require_once( ABSPATH . 'wp-admin' . '/includes/image.php' );
              $attachemt_data = wp_generate_attachment_metadata( $attachment_id, $upload_file['file'] );
            
              wp_update_attachment_metadata( $attachment_id, $attachemt_data );

              array_push( $new_ids_arr, $attachment_id );
            
              error_log( "Inserted and attached gallery image " . $file );
            }
          }else{
            error_log( "Error with post " . $post['post_name'] . " image: " . $file );
          }
          break;
        }
      }
    }

    $new_ids_substr = implode( ",", $new_ids_arr );
    $post_content = str_replace( $ids_substr, $new_ids_substr, $post->post_content );

    $args = array( 
      "ID" => $post_id,
      "post_content" => $post_content
     );

    $upldate_result = wp_update_post( $args );

    if( $upldate_result ) error_log( $i . ". Updated gallery of " . $post->post_name );
    else error_log( $i . ". Error while updating " . $post->post_name );
  }
  $i++;
}

error_log("Total images in galleries: " . $img_count );